// Photography.jsx
import React from 'react';
import './Photography.css';

const Photography = () => {
  return (
    <div className="photography">
      <h1>Photography</h1>
      
      <div className="redbubble-links">
        <a href="https://www.redbubble.com/people/yourusername/works/12345678" target="_blank" rel="noopener noreferrer">
          <img src="photo1.jpg" alt="Photo 1" />
          <p>Photo 1 Title</p>
        </a>
        <a href="https://www.redbubble.com/people/yourusername/works/87654321" target="_blank" rel="noopener noreferrer">
          <img src="photo2.jpg" alt="Photo 2" />
          <p>Photo 2 Title</p>
        </a>
        <a href="https://www.redbubble.com/people/yourusername/works/11223344" target="_blank" rel="noopener noreferrer">
          <img src="photo3.jpg" alt="Photo 3" />
          <p>Photo 3 Title</p>
        </a>
      </div>
    </div>
  );
};

export default Photography;
